import ExpenseItem from './ExpenseItem';

export function Expenses({items}) {

  return (
    <>
      <ExpenseItem item={items.itemsInit[0]} />
      <ExpenseItem item={items.itemsInit[1]} />
      <ExpenseItem item={items.itemsInit[2]} />
    </>
  );
}
